import Description from './components/Description.js';
import TabGroup from './components/TabGroup.js';
import './App.css';

import { Helmet } from 'react-helmet';

function App() {

  return (
    <div className="app">
      <div className="content">
        <Description />
        <TabGroup />
        <br></br>
        <br></br>
      </div>
    </div>
  );
}

export default App;
